function Noticia(conteudo, capa, titulo){

    this.conteudo = conteudo;
    this.capa = capa;
    this.titulo = titulo;

    return {
        conteudo: conteudo,
        titulo: titulo,
        capa: capa,
    };

}

export default Noticia;
